let initialState = {
    profileData: {
        dialogsData: [
            {id: 1, name: 'Dima'},
            {id: 2, name: 'Andre'},
            {id: 3, name: 'Sasha'},
        ],
        messagesData: [
            {id: 1, message: 'hi'},
            {id: 2, message: 'hi'},
            {id: 3, message: 'hi'},
            {id: 4, message: 'hi'},
        ],
    },
};

const DataReducer = (state = initialState, ) => {

    return state;
}
export default DataReducer
